import React from 'react';

const Footer = () => {
  return (
    <div className=' footer'>
      <div className="descript">
        <h3>
          organic Kitcheen
          <br />
          recipes.
        </h3>
        <p>
          Our blog is dedicated to sharing wholesome organic recipes that promote
          a healthy and sustainable lifestyle. We provide easy-to-follow guides
          and tips for preparing nutritious meals using organic ingredients,
          helping you make better choices for yourself and the planet.
        </p>
      </div>
      <button className='btn-secondary'>Sign in</button>

    </div>
  );
};

export default Footer;
